import os
import time
from langchain.chains import GraphQAChain
from langchain_community.graphs.networkx_graph import NetworkxEntityGraph
import pandas as pd

"""![image.png](data:image/png;base64,)"""

from langchain_nvidia_ai_endpoints import ChatNVIDIA

client = ChatNVIDIA(
  model="meta/llama-3.1-405b-instruct",
  api_key="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",
  temperature=0.2,
  top_p=0.7,
  max_tokens=1024,
)

"""Meta's LLaMA 3.1 405B is a powerful large language model with 405 billion parameters, designed to push the boundaries of natural language understanding and generation. It focuses on improving efficiency, accuracy, and contextual understanding, making it highly effective for complex tasks like question answering, content generation, and reasoning. LLaMA 3.1 builds on the advancements of earlier models, providing state-of-the-art performance across various NLP applications.

The file contains relationships between medical conditions, with key columns as follows:

- **Source**: Lists the primary condition (e.g., "Cardiovascular Disease History").
- **Target**: Lists associated conditions (e.g., "Hypertension", "Type 2 Diabetes").
- **Description**: Provides details on the connection between the source and target conditions (e.g., "Hypertension is a significant part of the Cardiovascular Disease History").

Each row establishes a relationship between a source and target condition with additional metadata like description, weight, and ranking information.
"""

df = pd.read_parquet('/content/create_final_relationships.parquet')
df.head()

"""We will create a graph using the `NetworkxEntityGraph()` class.

1. **Adding nodes**: The first loop iterates through each row of the dataframe (`df`) and adds both the `source` and `target` values as nodes in the graph.
2. **Adding edges**: The second loop adds edges (connections) between the nodes based on the `source` and `target`, with an additional edge attribute called `relation`, which stores the description of the relationship between the nodes.
"""

graph = NetworkxEntityGraph()

#Add nodes
for id,row in df.iterrows():
  graph.add_node(row['source'])
  graph.add_node(row['target'])

#Add edges to the graph
for id,row in df.iterrows():
  graph._graph.add_edge(row['source'],
                        row['target'],
                        relation=row['description']
                        )

chain = GraphQAChain.from_llm(
    llm=client,
    graph=graph,
    verbose=True
)

"""This code snippet uses the `GraphQAChain` class to create a question-answering (QA) chain based on a graph, leveraging a language model (LLM) to interpret the graph's information.

1. **Chain creation**: The `GraphQAChain.from_llm` initializes a question-answering system that uses the provided `llm` (language model client) and `graph` (a `NetworkxEntityGraph`).
2. **Question**: The variable `question` holds the query ("Does Type 2 Diabetes play a role in CVD?").
3. **Running the chain**: `chain.run(question)` processes the question using the graph and the LLM to extract an answer by traversing relationships and entities in the graph. The `verbose=True` parameter ensures detailed logging of the process.
"""

question = "Does Type 2 Diabetes play a role in CVD?"
chain.run(question)

